         @Override
         public AcquisitionEvent run(AcquisitionEvent event) {
            if (!event.isAcquisitionFinishedEvent()
                  && (event.getZIndex() == null || event.getZIndex() == 0)
                  && (event.getAxisPosition(MDAAcqEventModules.POSITION_AXIS) == null
